    createByUser: NumberInt("7"),
    name: "【Nuxt】Google Analytics",
    html: "<p style=\"line-height: 1;\"><br></p><h1 style=\"text-align: center;\">GOOGLE ANALYTICS 教程：如何给网站加GA代码</h1><p><br></p><p><br></p><p>Google Analytics ，一般直接简称GA（后续使用简称），是目前使用较为广泛的网站流量分析工具（其实也支持移动app和其他联网设备数据的收集），包括我们熟知的知乎、豆瓣、携程等大流量站点都有使用GA来做网站流量数据的收集。</p><p>本文将介绍如何给网站加GA 代码，并以此作为《Google Analytics 教程》系列文章的第一篇。</p><h3></h3><h3><strong>1. 获取GA 代码</strong></h3><p>进入<a href=\"https://analytics.google.com/analytics/web/?hl=zh-cn\" target=\"_blank\">GA 后台</a> ，点击左上侧管理，选择需要添加代码的网站对应的账号和媒体资源后，依次点击媒体资源下的<span style=\"font-size: 14px;\"><strong>跟踪信息</strong></span>-<span style=\"font-size: 14px;\"><strong>跟踪代码</strong></span>，可以看到如下所示界面：</p><p>红色框线里的代码即是GA 基础代码，也就是本文所说需要加到网站上的GA 代码。</p><p><img src=\"data:image/png;base64,\" alt=\"image.png\" data-href=\"\" style=\"width: 705.00px;height: 417.81px;\"/></p><h3><strong>2. 添加GA 代码到网站</strong></h3><p>复制上述GA 代码，将之添加到网站<span style=\"font-size: 14px;\"><strong>所有需要监测的页面</strong></span>。</p><p>在plugins中添加ga.js代码如下</p><pre><code class=\"language-javascript\">/*\n ** 只在生产模式的客户端中使用\n */\n\n\n(function () {\n  var hm = document.createElement(\"script\");\n  hm.src = \"https://www.googletagmanager.com/gtag/js?id=G-N8464N6KV6\";\n  hm.async = 1;\n  hm.id = \"chrome_fx\";\n  var s = document.getElementsByTagName(\"script\")[0];\n  s.parentNode.insertBefore(hm, s);\n  window.dataLayer = window.dataLayer || [];\n  function gtag() {\n    dataLayer.push(arguments);\n  }\n  gtag('js', new Date());\n  gtag('config', 'G-N8464N6KV6');\n})();\n\n/*\n ** 应用挂载后\n */\nwindow.onNuxtReady((app) =&gt; {\n  app.$nuxt.$on('routeChanged', (to, from) =&gt; {\n    var _hmt = _hmt || [];\n    (function () {\n      document.getElementById('chrome_fx') && document.getElementById('chrome_fx').remove()\n      var hm = document.createElement(\"script\");\n      hm.src = \"https://www.googletagmanager.com/gtag/js?id=G-N8464N6KV6\";\n      hm.async = 1;\n      hm.id = \"chrome_fx\";\n      var s = document.getElementsByTagName(\"script\")[0];\n      s.parentNode.insertBefore(hm, s);\n      window.dataLayer = window.dataLayer || [];\n      function gtag() {\n        dataLayer.push(arguments);\n      }\n      gtag('js', new Date());\n      gtag('config', 'G-N8464N6KV6');\n    })();\n  })\n})</code></pre><h3><strong>在nuxt.config.js文件内</strong><span style=\"color: rgb(0, 0, 0);\">plugins添加</span></h3><pre><code class=\"language-javascript\">plugins: [\n    {\n      src: '@/plugins/baidu-seo-push.js',\n      ssr: false\n    },\n    {\n      src: '@/plugins/ga.js',\n      ssr: false\n    },\n  ],</code></pre><h3><strong>3. 验证代码添加是否成功</strong></h3><p>要验证代码是否添加成功，方法有很多。比如，可以用浏览器访问下已经添加了GA 代码的页面，然后切换到GA 后台，点击顶部导航<span style=\"font-size: 14px;\"><strong>报告，</strong></span>依次点击<span style=\"font-size: 14px;\"><strong>实时</strong></span>-<span style=\"font-size: 14px;\"><strong>概览，</strong></span>查看下目前是否显示有活跃用户。</p><p>如果你熟悉浏览器开发者工具，可以抓包看下页面打开或者刷新的时候是否有以https://www.google-analytics.com/collect? 开头的请求发出，类似如下所示：</p><p><img src=\"data:image/png;base64,\" alt=\"image.png\" data-href=\"\" style=\"width: 966.00px;height: 362.82px;\"/></p><p>如果有这种请求发出，说明页面上已经成功添加了GA 代码。</p><p>OK，到这里如何添加GA代码就介绍完了，有任何疑问可以留言与我交流哈~</p><p><br></p>",
