    name: "【Nuxt】 安装Prismjs",
    html: "<p><br></p><h3>1.安装 prism.js</h3><p><br></p><pre style=\"text-align: left;\"><code class=\"language-javascript\">npm i --save Prismjs \nnpm i --save babel-plugin-prismjs </code></pre><h3>2.在plugins中添加prism.js代码如下</h3><pre><code class=\"language-javascript\">import Prism from 'prismjs';\nimport 'prismjs/themes/prism-okaidia.css';\nexport default Prism\n</code></pre><h3>3.配置nuxt.config.js文件</h3><p>在这个位置:</p><pre style=\"text-align: left;\"><code class=\"language-javascript\"> babel: {\n      // compact: false,\n      plugins: [\n        [\n          'prismjs',\n          {\n            languages: \"all\",\n            //配置显示行号插件\n            plugins: [\n              // 'toolbar',\n              'line-numbers',\n              'show-language',\n              'copy-to-clipboard'\n            ],\n            theme: 'okaidia', //主体名称\n            css: true\n          }\n        ]\n      ]\n    },\n plugins: [\n    {\n      src: '@/plugins/baidu-seo-push.js',\n      ssr: false\n    },\n    {\n      src: '@/plugins/ga.js',\n      ssr: false\n    },\n    {\n      src: \"@/plugins/prism\",\n      ssr: false\n    },\n  ],\n    </code></pre><p><br></p>",
