    html: "<h1 style=\"text-align: center;\">【vue】02-指令</h1><blockquote>正文</blockquote><h3>一、Vue 的实例</h3><p>通过上节课，我们知道如何引入 Vue 来工作，初学者不建议使用 vue-cli 来创建项目，在这里我们使用引入 script 来编写 Vue demo</p><p>Vue 完全可以看做是面向对象的语言，我们创建一个 Vue 的实例一般是这样做的</p><p><br></p><pre style=\"text-align: left; line-height: 1.5;\"><code class=\"language-vue.js .js  language-vue\" style=\"text-align: left; line-height: 1.5;\">var vm = new Vue({\n  // 数据\n  data:{\n  }，\n  methods:{\n    // 方法\n  }，\n  等等其它 \n})\n</code></pre><p>我们可以看到 -- data 作为属性、methods 作为方法，new Vue 就是一个实例对象，这样理解 Vue 就会很轻松「如果有面向对象的基础」</p><h3>二、什么是指令</h3><p>传统意义上的指令就是指挥机器工作的指示和命令，vue 中的指令一般是以 v- 开头</p><p>vue 中的指令的职责是，当表达式的值改变时，会响应式的对 DOM 产生影响</p><p>在开始指令之前，我们先来一个 helloWorld 来直观的感受下下 Vue 吧</p><h4>1、先来一个 HelloWorld</h4><p>在这里我使用 atom 来开发</p><blockquote>1、新建一个目录，并且导入 vue.js 如下</blockquote>",
